import React from 'react';
import CTA from './CTA';
import ME from '../../assets/my_photo.png'

// Import Styles
import './Header.css';

const Header = () => {
  return (
    <header>
      <div className="container header__container">
        <h5>Hello I'm</h5>
        <h1>Mohammad Ali</h1>
        <h5 className='text-light'>React Frontend Developer</h5>
        <CTA />

        <div className="me">
          <img src="" alt="" />
        </div>
      </div>
    </header>
  )
}

export default Header
